@MaxMarshallVA Fam, I'm British. It's just how I type.

I've spoke with a serious tone because I want to take this issue seriously, especially when it comes to educating of healthier long-term business practise.

Sure, it takes grind. But, it's less likely to leave a black mark on your name.

@MaxMarshallVA You immediately implied I was vilifying others, when my goal since joining the VA community was to help it grow.

I'd recommend getting to know someone before assuming ill-will or bad intent.

My heart genuinely weeps for my friends who've had awful experiences due to Fiverr.

@VoMylo @jeffreynbaker 2 seconds onto the website, and I'm prompted to hire a voice actress for ¬£12 for 150 lines for a professional commercial, with only ¬£40 for the commercial rights.

Via an agency, the same job would be valued in thousands.

How do you not see the industry issue with the site?

@KenMarsigliaVo I look forward to seeing how you feel about it in a couple of months.

Initial success may seem great (I've been there), but I've seen enough of the horror stories that I am genuinely concerned for you and others on the site. 

Best of luck with it all though, I need to sleep. üí§

@TalonSimsVA Sorry for missing this, here's my list of why bad;

As for, "isn't making some money better than making none?"

No. It's exploitation. At least if you're being unpaid, you know the expectations that come with it. Less so when you're being criminally undervalued for industry work. https://t.co/1SvPKWxB4t

