@Aceofspadescos 3/10

Oh boy, you need to be a lot more specific. While I'm glad you dropped a photo, I can't tell if you're trying to sell yourself as the photographer, designer or model themselves based on what's in your actual tweet.

'Making' is such a vague term in today's world! https://t.co/jAXmy2zmDf

@daelix20 2/10

This could use a lot more work. While you do mention what you do and what you enjoy, it's also good to fluff it up quite a bit.

What graphic design do you do? What have you edited recently? What kind of editing do you like most? Think of questions like these. https://t.co/SX6pI7FI4v

@OzzieLucius @GoatCoastCO 8/10

We love a furry, because a furry gets us work. üëè

While I don't know anything about fursuits, or the culture surrounding it, you do a great job in showing off. Main critique is maybe adding a few more photos with different poses. So much stronger to show, instead of tell! https://t.co/2HOuIFOSU8

@LacTheWatcher 6/10

Whilst nice to note your years of experience, good to follow that up with confidence in specific voice types you've been cast as. 

Avoid words like 'pursue' as, although you've got experience, it makes it sound like you're still *trying*. Oh, and avoid YT channel links! https://t.co/FzgvBFz0Ic

@ZacharySalsa 7/10

Friendly conversational style, still a little *too* varied with character types. Try to focus on a vocal pitch, and let your reel sell you. Perfect sign off.

-1 point though for using the Soundcloud Mobile link, which takes off-site, instead of hearing on Twitter! https://t.co/NIRBXF3b2V

@sithwitch 7/10

While I appreciate a good 'yo', I could also see it being seen as rude, depending on the client. Great understanding of your vocal niche, but could do with some descriptors.

Instead of linking to your site, getting into the habit of direct audio upload is a lot stronger! https://t.co/ZpQoZFij4C

@BladedSK 7/10

I want to give you more points, but the 'small creatures to beastly warriors' is veeeery vague, and thus, points must be docked. Choose one side of the spectrum, whichever you prefer, and urge the client to 'listen to my reel, for more!' 

Reel 'em in (quite literally). https://t.co/Z5TdAB2yy9

@KaniDayOfficial 7/10

Not gonna lie, most of these points come from the kick-ass visual reel (so much more powerful than a vocal reel).

As for your tweet itself, it could do with some work. Avoid using 'etc', and be specific instead, especially with your strengths as a voice actress! https://t.co/YyFWQV5R3F

@vaPears 6/10

Nailed the basics, and attached your reel splendidly!

Main thing is just fluffing it up, and being a bit more specific. What kind of voice are you best at? What experience do you have? What genres are you interested in? etc https://t.co/UPKfa6OwM6

@BlitzeoArtsVA 7/10

While your post itself is pretty solid, I wish you'd choose a speciality in that sentence to expand with the rest of your abilities.

"I have a varied vocal range, but known for x", as an example. It's an immediate way of setting yourself apart from the 'versatile' crowd. https://t.co/eRHPxmRWXi

@JuliaGuVO 9/10

Absolutely solid in your delivery. Friendly and onfident wording, knowing what you're good at, and throwing in that additional nod of work in a different language.

Only worry is the copy and paste nature, which could be worth adjusting depending on potential clients! https://t.co/DGLyKIlHti

@SuperGGRadio 7/10

Descriptive in what you're trying to get people to watch, and appreciate the wholesome aspect of what you're promoting.

Key advice would be to include a clip of your podcast (direct video upload), instead of an off-site link. It'll help sell more than anything else! https://t.co/PpJHoOxfKq

@MistressDove 3/10

Whilst I adore your politeness, I think you're being waaay too reserved, and lacking a fair amount of key elements (demo reel, telling your vocal niche, etc).

If anything, scroll through replies in this thread, and try and learn from some of the higher graded replies! https://t.co/ahtrdxQRPc

@CJWilsonVA 9/10

Friendly, conversational tone. Expression of your resume, but with the ability for the client to learn more. Nailing your niche, and sufficient links.

Honestly, I can't really find any specific faults in this one, aside from maybe formatting the tweet a little nicer! https://t.co/LHVPomjeuv

@CJ_Heineman @TunnelVa 4/10

Aaaah, the v-word once again!

Lacking a link to your work, no confidence in a specific niche (which is the best thing to touch base with), and unfortunately comes across as way too generic. Good marketing is showing a level of uniqueness, after all! https://t.co/sdmlxdXSge

@TomStheVoice 6/10

Good idea of your vocal niches, but another case of stretching abilities too thin instead of focusing on main niches and showing them off more confidently.

Perfect link to your reel, but I also don't like the 'So, who's next', as it doesn't really fit with everything else! https://t.co/dkl5PtBYGF

@WillPowerEngel 5/10

Aaaaaaaaaah, you used the v-word.

Be specific in your best abilities, and be loud and proud of them. Even if you don't know your niche personally, just go based on what people have told you, or how clients have cast you. It helps to get that vocal baseline! https://t.co/0lEicpzdXA

@keyvoicesvo 6/10

While you've hit some great strides in talking about your resume, better to prove than just tell. Whether it be via a direct link to a visual reel of those works, or to your website.

Could definitely work on just being a bit more informal! https://t.co/xsc4P6m8wG

@adriel_varlack 6/10

I will admit, you immediately lost a point due to me thinking about your knuckles cracking.

Buuuut, pretty damn solid. Good example of your vocal niches with the direct link, buuuuut, 'look no further' is really cheesy and quite outdated. https://t.co/blRvXQFtSI

@MinhyVa 9/10

Perfect description of your niches, whilst letting your demo speak for itself with the attached link. Extra bonus points for email contact information too!

Only concern is possible 'copy and paste' perception, which may be a detriment if sent to multiple people in one day! https://t.co/ptEmUlvw60

@MickelPickelVA 7/10

High points for a direct video link, appreciate not needing to click off the tweet itself to hear your voice!

But, you're a bit general in describing your abilities. Be specific and confident about what you're good at, and let the other voices show themselves in your reel! https://t.co/Py12lWVNeT

@VoicedByKenneth 9/10

Hot damn, we got a high score right now.

Perfect analysis of your own voice and abilities, being specific in your strengths. Direct link to a demo (which doesn't involve leaving the website), and a perfectly friendly formal writing style. Bravissimo! https://t.co/JMTvmTpM5K

@SpencerButlerVA 6/10

You know when you hear a word so much it starts slowly not sounding like a real word..? Yeah, that.

But, great confidence, and a link to a tweet with all the information gets you them points. Great effort! https://t.co/dvEQC0P4Kd

@Agent0Fluffy 5/10

Admiring the confidence, and the showing off of not 1, but 2 reels!

But, I wouldn't ever date your work, as a client may not perceive that as the accurate version of the 'current' you. Aaand, would personally avoid using pony artwork, as it could be seen as unprofessional. https://t.co/E3VkDcR5Dn

@TheJonwaters 8/10

Confident delivery, AND appealing to the audience with content they'd enjoy.

(While this is great for me as individual however, probably not best to send a D&amp;D related clip to every potential client though. It seems pretty unprofessional at first glance!) https://t.co/cZfsO0LAA0

@MasonStewartVO 5/10

Friendly and conversational use of language, which is great. But, could do with slightly more oomph.

Website is always great, but try and make your profile do the selling instead. It helps in our more modern age where people can message you directly on Twitter! https://t.co/I7pQNtFJvk

@shakyradunn 6/10

Confident enough use of language, apt description of your abilities, and a link to your channel.

However, external links are a bit of a hassle, and never good to send someone to a different site. Better to link to a direct tweet with your content next time! ‚ú® https://t.co/rhLSvM2obc

@LatinFireVA 4/10

Attached your demo, which is always fantastic, and can't go wrong with a good ol' pun.

But, too many ...'s, which gives the appearance of a severe lack of confidence. Ramp it up, get more excited, and appear more sure of yourself next time! https://t.co/kMBjVExv0A

@joyhva 6/10.

Enthusiasm is appreciated, Venus tagline makes you seem like more of a wrestler than a voice actor, but I really dig it. The 'sweet, spicy, silky, or sour' part made me feel reaaaally uncomfortable, and I don't really know why.

In all, a good effort though. ‚ú® https://t.co/BL2lpiyrHj

@PyrOMG (obviously, it's a bit more complex with larger work, but the gist is;
- all contracts should give you an out, otherwise it's legalised slavery.
- nda and read before *officially* committing to anything too big.
- you can still say "this isn't for me" late in the process.)

@PyrOMG Definitely don't sign any contracts which say, "I am owned by you until I finish this work", lmao.

Most contracts should state that you are able to cancel the work, and forfeit payment, if it comes to that.

Whole point of an NDA is to see the script before invoicing anyway.

@visodette For me, 9 times out of 10, it's one of two things;

1) Too much shitposting.
2) Inactivity on their accounts.

If someone hasn't tweeted in 3 months, I don't really see the point in following them right now. Which, could always change if they're active again.

@Hbomberguy The analogy was so apparent, I was waiting to see how long until they realised it.

Or, because they know the masses love it, they're not going to even risk putting their necks on the line when they can make easy jabs at the films instead.

It's getting too predictable, fam.

@jemrudolph "well actually, I was told..."

